import React, { Component } from 'react';

// import items from '../data/item';

const items = [
    {
        label: "Drink Coffee"
    },
    {
        label: "Build React App"
    }
]

export default class ToDoItem extends Component {
    constructor(props){
        super(props);
    
        this.state = {
            items: items,
            important: false
        };
      }


  render() {
        return (
            this.state.items.map( (index) => 
                <li style={colothis.state.important ? 'tomato': 'black'}>{index.label}</li>
            )
        )
  }
}
